pragma solidity 0.8.7;
pragma experimental ABIEncoderV2;
import "hardhat/console.sol";
abstract contract Ownable {
  address private _owner;

  constructor() {
    _owner = msg.sender;
  }

  function owner() public view virtual returns (address) {
    return _owner;
  }

  modifier onlyOwner() {
    require(owner() == msg.sender, "Ownable: caller is not the owner");
    _;
  }

  function transferOwnership(address newOwner) public virtual onlyOwner {
    require(newOwner != address(0), "Ownable: new owner is the zero address");
    _owner = newOwner;
  }
}

abstract contract Helper is Ownable {
  string public UNKNOWN_STRING = "UNKNOWN";
  uint256 public UNKNOWN_UINT = 0;
  address public UNKNOWN_ADDRESS = address(0);
  bytes public EMPTY_BYTES;

  function isEmptyBytes(bytes memory _bytes) internal view returns (bool) {
    return keccak256(abi.encodePacked(_bytes)) == keccak256(abi.encodePacked(EMPTY_BYTES));
  }

  function isZeroAddress(address _address) internal view returns (bool) {
    return _address == UNKNOWN_ADDRESS;
  }

  /* Ownable Function */
  function setUnKnownString(string memory _unknown) external onlyOwner {
    UNKNOWN_STRING = _unknown;
  }

  function setUnknownUint(uint256 _unknown) external onlyOwner {
    UNKNOWN_UINT = _unknown;
  }

  function setUnknownAddress(address _unknown) external onlyOwner {
    UNKNOWN_ADDRESS = _unknown;
  }
}

abstract contract Block {
  function getBlockHash(uint256 blockNumber) public view returns (bytes32 blockHash) {
    blockHash = blockhash(blockNumber);
  }

  function getBlockNumber() public view returns (uint256 blockNumber) {
    blockNumber = block.number;
  }

  function getCurrentBlockCoinbase() public view returns (address coinbase) {
    coinbase = block.coinbase;
  }

  function getCurrentBlockDifficulty() public view returns (uint256 difficulty) {
    difficulty = block.difficulty;
  }

  function getCurrentBlockGasLimit() public view returns (uint256 gaslimit) {
    gaslimit = block.gaslimit;
  }

  function getCurrentBlockTimestamp() public view returns (uint256 timestamp) {
    timestamp = block.timestamp;
  }

  function getLastBlockHash() public view returns (bytes32 blockHash) {
    blockHash = blockhash(block.number - 1);
  }

  function getBlockBaseFee() public view returns (uint256 baseFee) {
    require(getChainId() == 1, "Unable to get baseFee");
    baseFee = block.basefee;
  }

  function getChainId() public view returns (uint256 chainId) {
    chainId = block.chainid;
  }
}

abstract contract Pair is Helper {
  struct EachPair {
    address token;
    uint256 reserve;
  }

  struct PairInfo {
    bool isPair;
    address pair;
    EachPair token0;
    EachPair token1;
  }

  function safePairInfo(address pair)
    public
    view
    returns (
      bool isPair,
      EachPair memory token0,
      EachPair memory token1
    )
  {
    (bool successToken0, bytes memory token0Data) = pair.staticcall(abi.encodeWithSelector(0x0dfe1681));
    if (!successToken0) {
      return (false, EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }), EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }));
    }
    (bool successToken1, bytes memory token1Data) = pair.staticcall(abi.encodeWithSelector(0xd21220a7));
    if (!successToken1) {
      return (false, EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }), EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }));
    }
    (bool successReserves, bytes memory reserveData) = pair.staticcall(abi.encodeWithSelector(0x0902f1ac));
    if (!successReserves) {
      return (false, EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }), EachPair({ token: UNKNOWN_ADDRESS, reserve: UNKNOWN_UINT }));
    }

    address token0Address = !isEmptyBytes(token0Data) ? abi.decode(token0Data, (address)) : UNKNOWN_ADDRESS;
    address token1Address = !isEmptyBytes(token1Data) ? abi.decode(token1Data, (address)) : UNKNOWN_ADDRESS;
    (uint256 token0Reserve, uint256 token1Reserve) = !isEmptyBytes(reserveData)
      ? abi.decode(reserveData, (uint256, uint256))
      : (UNKNOWN_UINT, UNKNOWN_UINT);

    isPair = !isZeroAddress(token0Address) && !isZeroAddress(token1Address);
    return (isPair, EachPair({token: token0Address, reserve: token0Reserve}), EachPair({token: token1Address, reserve: token1Reserve}));
  }

  function getBatchPairInfos(address[] memory _pairs) external view returns (PairInfo[] memory _pairInfos) {
    _pairInfos = new PairInfo[](_pairs.length);
    for (uint256 i = 0; i < _pairs.length; i++) {
      address targetPair = _pairs[i];

      _pairInfos[i].pair = targetPair;
      (_pairInfos[i].isPair, _pairInfos[i].token0, _pairInfos[i].token1) = safePairInfo(targetPair);
    }
  }
}

abstract contract ERC20 is Helper {
  struct ERC20Info {
    string name;
    string symbol;
    uint256 decimals;
    uint256 totalSupply;
  }

  struct BalanceInfo {
    address token;
    uint256 balance;
  }

  function safeERC20Name(address token) public view returns (string memory) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x06fdde03));
    return success && !isEmptyBytes(data) ? abi.decode(data, (string)) : UNKNOWN_STRING;
  }

  function safeERC20Symbol(address token) public view returns (string memory) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x95d89b41));
    return success && !isEmptyBytes(data) ? abi.decode(data, (string)) : UNKNOWN_STRING;
  }

  function safeERC20Decimals(address token) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x313ce567));
    return success && !isEmptyBytes(data) ? abi.decode(data, (uint256)) : UNKNOWN_UINT;
  }

  function safeERC20TotalSupply(address token) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x18160ddd));
    return success && !isEmptyBytes(data) ? abi.decode(data, (uint256)) : UNKNOWN_UINT;
  }

  function safeERC20BalanceOf(address token, address holder) public view returns (uint256) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x70a08231, holder));
    return success && !isEmptyBytes(data) ? abi.decode(data, (uint256)) : UNKNOWN_UINT;
  }

  function getBatchERC20TotalSupply(address[] memory _tokens) public view returns (uint256[] memory totalSupplies) {
    totalSupplies = new uint256[](_tokens.length);

    for (uint256 i = 0; i < _tokens.length; i++) {
      totalSupplies[i] = safeERC20TotalSupply(_tokens[i]);
    }
  }

  function getBatchERC20Infos(address[] memory _tokens) public view returns (ERC20Info[] memory tokenInfos) {
    tokenInfos = new ERC20Info[](_tokens.length);

    for (uint256 i = 0; i < _tokens.length; i++) {
      address targetERC20 = _tokens[i];
      tokenInfos[i] = ERC20Info({
        name: safeERC20Name(targetERC20),
        symbol: safeERC20Symbol(targetERC20),
        decimals: safeERC20Decimals(targetERC20),
        totalSupply: safeERC20TotalSupply(targetERC20)
      });
    }
  }

  function getBatchERC20Balances(address[] memory users, address[] memory tokens) external view returns (uint256[] memory addrBalances) {
    addrBalances = new uint256[](tokens.length * users.length);

    for (uint256 i = 0; i < users.length; i++) {
      for (uint256 j = 0; j < tokens.length; j++) {
        uint256 addrIdx = j + tokens.length * i;
        if (tokens[j] != address(0x0)) {
          addrBalances[addrIdx] = safeERC20BalanceOf(tokens[j], users[i]);
        } else {
          addrBalances[addrIdx] = users[i].balance;
        }
      }
    }
  }
}

abstract contract ERC721 is Helper {
  struct ERC721Info {
    uint256 id;
    address owner;
    string tokenURI;
  }

  function safeERC721OwnerOf(address token, uint256 id) public view returns (address) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0x6352211e, id));
    return success && !isEmptyBytes(data) ? abi.decode(data, (address)) : UNKNOWN_ADDRESS;
  }

  function safeERC721TokenURI(address token, uint256 id) public view returns (string memory) {
    (bool success, bytes memory data) = token.staticcall(abi.encodeWithSelector(0xc87b56dd, id));
    return success && !isEmptyBytes(data) ? abi.decode(data, (string)) : UNKNOWN_STRING;
  }

  function getBatchERC721Infos(address _token, uint256[] memory _ids) public view returns (ERC721Info[] memory erc721Infos) {
    erc721Infos = new ERC721Info[](_ids.length);

    for (uint256 i = 0; i < _ids.length; i++) {
      erc721Infos[i] = ERC721Info({id: _ids[i], owner: safeERC721OwnerOf(_token, _ids[i]), tokenURI: safeERC721TokenURI(_token, _ids[i])});
    }
  }
}

abstract contract ChainLink is Helper {
  struct ChainLinkData {
    uint256 answer;
    uint256 decimals;
  }

  function safeChainLinkData(address feed) public view returns (ChainLinkData memory) {
    (bool successRoundData, bytes memory roundData) = feed.staticcall(abi.encodeWithSelector(0xfeaf968c));
    (, uint256 answer, , , ) = successRoundData && !isEmptyBytes(roundData)
      ? abi.decode(roundData, (uint80, uint256, uint256, uint256, uint80))
      : (0, UNKNOWN_UINT, 0, 0, 0);

    (bool successDecimalsData, bytes memory decimalsData) = feed.staticcall(abi.encodeWithSelector(0x313ce567));
    uint256 decimals = successDecimalsData && !isEmptyBytes(decimalsData) ? abi.decode(decimalsData, (uint256)) : 0;

    return ChainLinkData({answer: answer, decimals: decimals});
  }

  function getBatchChainLinkData(address[] memory _targetFeeds) public view returns (ChainLinkData[] memory _chainLinkData) {
    _chainLinkData = new ChainLinkData[](_targetFeeds.length);
    for (uint256 i = 0; i < _targetFeeds.length; i++) {
      address targetFeed = _targetFeeds[i];
      _chainLinkData[i] = safeChainLinkData(targetFeed);
    }
  }
}

abstract contract Address {
  function getCode(address target) public view returns (bytes memory code) {
    assembly {
      let size := extcodesize(target)
      code := mload(0x40)
      mstore(0x40, add(code, and(add(add(size, 0x20), 0x1f), not(0x1f))))
      mstore(code, size)
      extcodecopy(target, add(code, 0x20), 0, size)
    }
  }

  function checkCA(address target) public view returns (bool) {
    uint256 code;
    assembly {
      code := extcodesize(target)
    }
    return code > 0;
  }

  function getBatchGetCode(address[] memory _targetAddress) public view returns (bytes[] memory code) {
    code = new bytes[](_targetAddress.length);
    for (uint256 i = 0; i < _targetAddress.length; i++) {
      code[i] = getCode(_targetAddress[i]);
    }
  }

  function getBatchCheckCA(address[] memory _targetAddress) public view returns (bool[] memory result) {
    result = new bool[](_targetAddress.length);
    for (uint256 i = 0; i < _targetAddress.length; i++) {
      result[i] = checkCA(_targetAddress[i]);
    }
  }
}

abstract contract Aggregator {
  struct Call {
    address target;
    bytes callData;
  }

  struct Result {
    bool success;
    bytes returnData;
  }

  function aggregate(bool requireSuccess, Call[] memory calls) public returns (Result[] memory returnData) {
    returnData = new Result[](calls.length);
    for (uint256 i = 0; i < calls.length; i++) {
      (bool success, bytes memory ret) = calls[i].target.call(calls[i].callData);

      if (requireSuccess) {
        require(success, "multicall aggregate: call failed");
      }

      returnData[i] = Result(success, ret);
    }
  }

  function staticAggregate(bool requireSuccess, Call[] memory calls) public view returns (Result[] memory returnData) {
    returnData = new Result[](calls.length);
    for (uint256 i = 0; i < calls.length; i++) {
      (bool success, bytes memory ret) = calls[i].target.staticcall(calls[i].callData);

      if (requireSuccess) {
        require(success, "multicall aggregate: call failed");
      }

      returnData[i] = Result(success, ret);
    }
  }
}

contract MultiCall is Block, Pair, ERC20, ERC721, Address, ChainLink, Aggregator {}

